    id: "14a74fdd-931a-41b2-92f9-c26ea77974a1",
    name: "World Radio Day Maintenance Challenge",
    start: "2017-12-13",
    end: "2018-02-13",
    instructions: "<p>Let's manage our health and wellness by continuing to focus on our healthy habits and weight maintenance efforts.</p><p>We will record our weights once a week for 9 weeks (December 13 – February 13) and try to stay within +/- 3% of our pre-selected target weight. </p><p>You do not need to be a \"perfect\" maintainer to join these challenges. Anyone who wants accountability from a maintenance perspective is welcome to join, no matter whether you're trying to hold onto a plateau or you're sliding and want to prevent further regain. Plenty of people use it as motivation to help get themselves back down into their \"happy range.\" People also use these challenges to try out a new goal range (either higher or lower). The point here is to help you figure out what your maintenance means to you.</p><p>Signup deadline : Tue 12/12/2017 (11:59 pm, Eastern Time) </p><p>Week 1 : Wed 12/13/2017 - Tue 12/19/2017 <br>Week 2 : Wed 12/20/2017 - Tue 12/26/2017 <br>Week 3 : Wed 12/27/2017 - Tue 01/02/2018 <br>Week 4 : Wed 01/03/2018 - Tue 01/09/2018 <br>Week 5 : Wed 01/10/2018 - Tue 01/16/2018 <br>Week 6 : Wed 01/17/2018 - Tue 01/23/2018 <br>Week 7 : Wed 01/24/2018 - Tue 01/30/2018 <br>Week 8 : Wed 01/31/2018 - Tue 02/06/2018 <br>Week 9 : Wed 02/07/2018 - Tue 02/13/2018 -- World Radio Day </p><p>Results announced :  Wednesday 02/14/2018</p><p>About World Radio Day:<br>World Radio Day is an observance day held annually on 13 February[1]. World Radio Day is about celebrating radio, why we love it and why we need it today more than ever. A day to remember the unique power of radio to touch lives and bring people together across every corner of the globe[2]. It was proclaimed on 3 November 2011 by UNESCO's 36th General Conference after originally proposed by the Kingdom of Spain.<br><a href=\"https://www.google.com/url?q=https://en.wikipedia.org/wiki/World_Radio_Day&amp;sa=D&amp;ust=1514578087043000&amp;usg=AFQjCNFkyvt2OOFoz0YU9S5Z2Vbri4OKLQ\">https://en.wikipedia.org/wiki/World_Radio_Day</a> <br>-----------------------------------------------------------------------<br>You can use any method for calculating your weight that you like, if it is consistent. Many people just log the weight that the scale says. Others use a weighted moving average like the ones from <a href=\"https://www.google.com/url?q=http://www.weightgrapher.com&amp;sa=D&amp;ust=1514578087043000&amp;usg=AFQjCNG0uiHbScHWUewvg8-vPj1LCnwLpw\">http://www.weightgrapher.com</a> , <a href=\"https://www.google.com/url?q=http://trendweight.com&amp;sa=D&amp;ust=1514578087043000&amp;usg=AFQjCNH2I75lpHQ1L6fDilsIDy8YlPl33w\">http://trendweight.com</a>  or <a href=\"https://www.google.com/url?q=http://www.fourmilab.ch/hackdiet/online/hdo.html&amp;sa=D&amp;ust=1514578087043000&amp;usg=AFQjCNFdT5NyGG2vXxhaT55XuI8dxOx96A\">http://www.fourmilab.ch/hackdiet/online/hdo.html</a>  or just a simple running average.</p><p>In case you're wondering where we came up with +/- 3%, it is a big enough range to account for most normal water fluctuation, and small enough to not affect health.  </p><p><a href=\"https://www.google.com/url?q=http://www.sparkpeople.com/mypage_public_journal_individual.asp?blog_id%3D4924102&amp;sa=D&amp;ust=1514578087043000&amp;usg=AFQjCNHGOOUysHKQ-KkZ_KKhbRWeH7Ps2Q\">www.sparkpeople.com/mypage_public_journal_individual.asp?blog_id=4924102</a>  </p><p>The title of World Radio Day Maintainer will go to the person who has the smallest percent deviation from the weight in the center of your range over the course of the challenge. Your percent deviation from this central weight (up or down) will be calculated every week and then summed over all the weeks.</p><p>RULES:</p><p>1. Post your weight every week, any day you like, if it's no later than 11:59 pm Eastern Time, Tuesday, RIGHT HERE ON THIS FORM. On 12/13/2017 it will magically turn from a signup form into a logging form. Feel free to set a bookmark in your browser.</p><p>2. As a backup, we suggest you also post your number in a NEW MESSAGE to the thread for discussing the challenge just in case someone else accidentally clicked your ID:</p><p><a href=\"https://www.google.com/url?q=https://www.sparkpeople.com/myspark/team_messageboard_thread.asp?board%3D681x1111x68016873&amp;sa=D&amp;ust=1514578087043000&amp;usg=AFQjCNGO-1uLrdvJzxqZo4HkxRUw0YtKgw\">https://www.sparkpeople.com/myspark/team_messageboard_thread.asp?board=681x1111x68016873</a> </p><p>With 60+ people in these challenges, there's always the chance of a stray mouse click. You can also chat about the challenge in this thread.</p><p>3. You can post your weekly weight anytime during the week between the days listed, but it must be no earlier than Wednesday at 12:01 am and no later than 11:59 pm on the following Tuesday (Eastern Time). EARLY or LATE WEIGH-INS WILL NOT BE ACCEPTED. This means if you post at or after 12:01am Eastern Time on Wednesday, you will be dropped as an official challenger.</p><p>4. Even though you may be dropped as an \"official\" challenger, you will still be able to log your weigh-in. If you would like us to continue calculating your statistics, please SparkMail JEANKNEE with a weight for the week missed.</p><p>5. If you make a mistake logging your weight, you can just re-enter it. We will take the latest weight you enter up until the deadline.</p><p>6. If you need email reminders to log your weight, you can set them up using the Spark People planner. <a href=\"https://www.google.com/url?q=http://www.sparkpeople.com/planner&amp;sa=D&amp;ust=1514578087043000&amp;usg=AFQjCNHHQWnLKe0PmSJ9UzqhA0gBLqDzIw\">http://www.sparkpeople.com/planner</a> .  Or you can use Outlook or a Google calendar, or any number of free internet services such as <a href=\"https://www.google.com/url?q=http://www.memotome.com&amp;sa=D&amp;ust=1514578087043000&amp;usg=AFQjCNE2BnqoPfsKpfwXs4I2dZPxfuj2xg\">www.memotome.com</a> .</p><p>7. If you stray more than 3% above or below your chosen central weight, keep logging anyway - we'll track whether you got back within range, and continue calculating your average deviation and other stats. And successful maintainers know that it's exactly when you stray out of range that you especially need support and accountability!</p><p>Short link for this page:  <a href=\"https://www.google.com/url?q=https://goo.gl/forms/D43LRcs07DAiyNEu1&amp;sa=D&amp;ust=1514578087043000&amp;usg=AFQjCNEPoMPFATb_M2BWo4EInFlXAWDQOg\">https://goo.gl/forms/D43LRcs07DAiyNEu1</a></p>",
